	public static void readWord(String path) throws IOException, InvalidFormatException {

		XWPFDocument d = new XWPFDocument(OPCPackage.open(path));
        List<XWPFParagraph> paragraphList = d.getParagraphs();
	    for (XWPFParagraph p : paragraphList) {
	    	System.out.println("paragrap: " + p.getText());
	    	List<XWPFRun> runs = p.getRuns();
	    	for (XWPFRun r : runs) {
	    		System.out.println("\t---->run: " + r.text());
	    	}	
		}
	    
	    
	    for (XWPFTable t : d.getTables()) {
	    	System.out.println("table: " + t.getText());
	    	for(XWPFTableRow row: t.getRows()) {
	    		System.out.println("\t---->row: " + row.toString());
		    	for (XWPFTableCell cell : row.getTableCells()) {
		    		System.out.println("\t\t---->cell: " + cell.getText());
		    		for (XWPFParagraph p : cell.getParagraphs()) {
		    	    	System.out.println("\t\t\t---->cellParagrap: " + p.getText());
		    	    	List<XWPFRun> runs = p.getRuns();
		    	    	for (XWPFRun r : runs) {
		    	    		System.out.println("\t\t\t\t---->run: " + r.text());
		    	    	}	
		    		}
		    	}	
	    	}
		}

	    XWPFDocument d1 = new XWPFDocument(OPCPackage.open(path));
	    
	    XWPFDocument ddhope = xWPFDocumentReplace(d, d1, "H01.01.01.01", "http://10.252.10.236/assessment/self", "Học Viện Nông Nghiệp");
	    saveWord(path.replace("HVN", "VNU"), ddhope);

	}
	
	static XWPFHyperlinkRun createHyperlinkRun(XWPFParagraph paragraph, String uri) {
        String rId = paragraph.getDocument().getPackagePart().addExternalRelationship(
                uri,
                XWPFRelation.HYPERLINK.getRelation()
        ).getId();

        CTHyperlink cthyperLink=paragraph.getCTP().addNewHyperlink();
        cthyperLink.setId(rId);
        cthyperLink.addNewR();

        return new XWPFHyperlinkRun(
                cthyperLink,
                cthyperLink.getRArray(0),
                paragraph
        );
    }
	
	
	static XWPFHyperlinkRun createHyperlinkRunAtPosition(XWPFParagraph paragraph, String uri, int position, String tooltip) {
        String rId = paragraph.getDocument().getPackagePart().addExternalRelationship(
                uri,
                XWPFRelation.HYPERLINK.getRelation()
        ).getId();

//        CTP ctp = paragraph.getCTP();
        
        CTHyperlink cthyperLink=paragraph.getCTP().insertNewHyperlink(position);//.addNewHyperlink();
        cthyperLink.setId(rId);
        cthyperLink.addNewR();
        if(tooltip.length()>0)
      	  cthyperLink.setTooltip(tooltip);

        return new XWPFHyperlinkRun(
                cthyperLink,
                cthyperLink.getRArray(0),
                paragraph
        );
    }
	
	static XWPFHyperlinkRun createHyperlinkRun(XWPFParagraph paragraph, String uri, String tooltip) {
        String rId = paragraph.getDocument().getPackagePart().addExternalRelationship(
                uri,
                XWPFRelation.HYPERLINK.getRelation()
        ).getId();

//        CTP ctp = paragraph.getCTP();
        
        CTHyperlink cthyperLink=paragraph.getCTP().addNewHyperlink();
        cthyperLink.setId(rId);
        cthyperLink.addNewR();
        if(tooltip.length()>0)
      	  cthyperLink.setTooltip(tooltip);

        return new XWPFHyperlinkRun(
                cthyperLink,
                cthyperLink.getRArray(0),
                paragraph
        );
    }
	
	public static void paragraphReplace(List<XWPFParagraph> listParagrap1, List<XWPFParagraph> listParagrap2, String findText, String uri, String tooltip){
		int paragrapIndex = -1;
		int runIndex;

		for(XWPFParagraph p : listParagrap1) {
			paragrapIndex++;
			XWPFParagraph p2 = listParagrap2.get(paragrapIndex);
			String pText = p.getText();
        	if(pText.contains(findText)) {
        		
        		List<XWPFRun> runsP = p.getRuns();
        		runIndex = -1;
        		for(XWPFRun run : runsP) {
        			runIndex++;
        			if (!(run instanceof XWPFHyperlinkRun    //-----hien tai API khong ho tro remove Run la Hyperlink hoac Field
                            || run instanceof XWPFFieldRun)) {

	        			String text = run.text();

		                if(text.contains(findText)) {
		                	//xoa bo XWPFRun tai vi tri hien tai
		                	p2.removeRun(runIndex);
		                	
		                	XWPFHyperlinkRun link = createHyperlinkRunAtPosition(p2, uri, runIndex, tooltip);
		                	link.setText(text);
		                	link.setUnderline(UnderlinePatterns.SINGLE);
		                	link.setColor("0000FF");
		                }
                    }
        		}
        	}
		}
	}
	
	public static void tableParagraphReplace(List<XWPFParagraph> listParagrap1, List<XWPFParagraph> listParagrap2, String findText, String uri, String tooltip){
		int paragrapIndex = -1;
		int runIndex;
		int count = 0;
		
		for(XWPFParagraph p : listParagrap1) {
			paragrapIndex++;
			XWPFParagraph p2 = listParagrap2.get(paragrapIndex);
			String pText = p.getText();
        	if(pText.contains(findText)) {
        		
        		System.out.print("Size of XWPFRun: " + p.getRuns().size() + "/" + p2.getRuns().size() + "-------");
        		
        		List<XWPFRun> runsP = p.getRuns();
        		runIndex = -1;
        		for(XWPFRun run : runsP) {
        			runIndex++;
        			if (!(run instanceof XWPFHyperlinkRun    //-----hien tai API khong ho tro remove Run la Hyperlink hoac Field
                            || run instanceof XWPFFieldRun)) {

	        			String text = run.text();

		                if(text.contains(findText)) {
		                	count ++;
		                	//xoa bo XWPFRun tai vi tri hien tai
		                	p2.removeRun(runIndex);
		                	System.out.println("Size of XWPFRun: " + p.getRuns().size() + "/" + p2.getRuns().size());
		                	XWPFHyperlinkRun link = createHyperlinkRun(p2, uri, tooltip);
		                	link.setText(text);
		                	link.setUnderline(UnderlinePatterns.SINGLE);
		                	link.setColor("0000FF");
		                	System.out.println("Size of XWPFRun: " + p.getRuns().size() + "/" + p2.getRuns().size());
		                }
                    }
        		}
        	}
		}
		
		System.out.println("found : " + count);
	}
	
	public static XWPFDocument xWPFDocumentReplace(XWPFDocument doc, XWPFDocument doc2, String findText, String uri, String tooltip){
		//Replace in Paragraphs
		paragraphReplace(doc.getParagraphs(), doc2.getParagraphs(), findText, uri, tooltip);
		
		int tableIndex = -1;
		int rowIndex = -1;
		int cellIndex = -1;
		
		for (XWPFTable t : doc.getTables()) {
			tableIndex++;
			rowIndex = -1;
	    	for(XWPFTableRow row: t.getRows()) {
	    		rowIndex++;
	    		cellIndex = -1;
		    	for (XWPFTableCell cell : row.getTableCells()) {
		    		cellIndex++;
		    		if(cell.getText().contains(findText)) {
			    		List<XWPFParagraph> listParagrap1 = cell.getParagraphs();
			    		List<XWPFParagraph> listParagrap2 = doc2.getTables().get(tableIndex).getRow(rowIndex).getCell(cellIndex).getParagraphs();
//			    		System.out.println("Size: " + listParagrap1.size() + "/" + listParagrap2.size());
			    		tableParagraphReplace(listParagrap1, listParagrap2 , findText, uri, tooltip);
		    		}

		    	}	
	    	}
		}


        return doc2;
    }
    
	public static void saveWord(String filePath, XWPFDocument doc) throws IOException {
        FileOutputStream out = null;
        try{
            out = new FileOutputStream(filePath);
            doc.write(out);
        }
        finally{
            out.close();
        }
    }
	
